        console.log(props.card)
        props.onDeletePlace(props.card);
    }
    return (
        <PopupWithForm card name='delete' title='Вы уверены?' buttonName='Да' isOpen={props.isOpen} onClose={props.onClose} onSubmit={handleDelete} />
    )
}
